import React,{useState,useEffect} from 'react';
import Nav from './component/navbar/Nav';
import Footer from './component/footer/Footer';
import Carousel from './component/body/carousel/Carousel';
import MultiDiv from './component/body/multiDiv/Multidiv';

function App() {
  const [region,setRegion] = useState('IND');
  function getChangedRegion(data){
    console.log(data)
    setRegion(data)
  }
  return (
    <div>
      <Nav getRegion={getChangedRegion}/>
      <Carousel region={region}/>
      <MultiDiv/>
      <Footer/>
    </div>
  );
}

export default App;
